import React from 'react';
import { TextField, Fab } from '@material-ui/core';
import { Add, Remove } from '@material-ui/icons';

import '../css/CalculatorInput.css'

const CalculatorInput = ({ input, name, hasSoloAnalisys, changeInput, decInput }) => {


    if (!hasSoloAnalisys && (name === 'phosphor' || name === 'potassium')) {
        return <></>
    }
    return (
        <li className='input'>
            <div className='input-area'>
                <p className='input-label'>{input.label}</p>
                <TextField
                    fullWidth
                    value={input.value}
                    onChange={(event) => changeInput(event.target.value, name)}
                />
            </div>
            <div className='input-change-buttons'>
                <Fab size='small' color='secondary'>
                    <Remove
                        style={{ color: '#FFFFFF' }}
                        onChange={(event) => decInput(event.target.value, name)}
                    />
                </Fab>
                <Fab size='small' color='secondary'>
                    <Add style={{ color: '#FFFFFF' }} />
                </Fab>
            </div>
        </li>
    )
}

export default CalculatorInput;
